angular.module("app.templates", []).run(["$templateCache", function($templateCache) {$templateCache.put("app/features/social/templates/wall.template.html","<div layout=\"column\"><div layout-gt-sm=\"row\"><md-content flex=\"\" layout=\"column\" layout-align=\"center\" style=\"height: 90vh\"><md-content class=\"tweets-wall\" layout=\"column\" flex=\"\" layout-wrap=\"\" layout-padding=\"\" layout-margin=\"\" style=\"display: block\"><md-card ng-repeat=\"tweet in wallController.tweets | limitTo: 50\"><md-card-header><md-card-avatar><img class=\"md-user-avatar\" ng-src=\"{{tweet.user.profile_image_url}}\"></md-card-avatar><md-card-header-text><span class=\"md-title\">{{tweet.user.name}}</span><span class=\"md-subhead\">@{{tweet.user.screen_name}}</span></md-card-header-text></md-card-header><md-card-content><p>{{tweet.text}}</p></md-card-content></md-card></md-content></md-content><div class=\"gallery-wall\" flex=\"50\"></div></div><div layout-gt-sm=\"row\"><md-content layout=\"row\" layout-wrap=\"\" layout-padding=\"\" layout-margin=\"\" layout-align=\"center center\"><div ng-repeat=\"(key, prop) in mainController.participants\"><div ng-switch=\"\" on=\"mainController.participants[key].twitter ? \'twitter\' : \'github\'\"><img class=\"mm-avatar\" ng-switch-when=\"twitter\" ng-src=\"https://twitter.com/{{mainController.participants[key].twitter}}/profile_image?size=original\" height=\"120px\" width=\"120px\" alt=\"\"><img class=\"mm-avatar\" ng-switch-when=\"github\" ng-src=\"https://avatars.githubusercontent.com/{{mainController.participants[key].github}}?s=120\" height=\"120px\" width=\"120px\" alt=\"\"></div><br><h4><b>{{mainController.participants[key].name}}</b></h4><p layout=\"row\" layout-align=\"center center\"><a ng-if=\"mainController.participants[key].website\" target=\"_blank\" ng-href=\"{{mainController.participants[key].website}}\"><ng-md-icon icon=\"create\" size=\"24\" style=\"fill: #337ab7\"></ng-md-icon></a><a ng-if=\"mainController.participants[key].twitter\" target=\"_blank\" ng-href=\"http://twitter.com/{{mainController.participants[key].twitter}}\"><ng-md-icon icon=\"twitter\" size=\"24\" style=\"fill: #337ab7\"></ng-md-icon></a><a ng-if=\"mainController.participants[key].github\" target=\"_blank\" ng-href=\"http://github.com/{{mainController.participants[key].github}}\"><ng-md-icon icon=\"github-circle\" size=\"24\" style=\"fill: #337ab7\"></ng-md-icon></a></p><br><br></div></md-content></div></div>");}]);